import React from 'react'
import { Hero } from '../Components/Hero'
import { Navbar } from '../Components/Navbar'
import { SelectorList } from '../Components/SelectorList'
import { Card } from '../Components/Card'
import { CardManga, Cardtest } from '../Components/CardManga'

export const Index = (props) => {
	const dataHandle = () => {
			if(props.getSeach === 'anime') {
				return (
					<Card getAnime={props.getAnime} />
				)
			}else if(props.getSeach === 'manga') {
				return (
					<CardManga getAnime={props.getAnime} />
				)
			}
	}
				// <Card getAnime={props.getAnime} getSeach={props.getSeach} />
	return (
		<div className={`${props.loading ? 'hidden' : 'block'}`}>
			<Hero />
			<Navbar />
				<SelectorList setGetSeach={props.setGetSeach} getSeach={props.getSeach} />
				{/* <Card getAnime={props.getAnime} getSeach={props.getSeach}/> */}
				{dataHandle()}
				<div className='h-screen'></div>
		</div>
	)
}
